import Service from "./Service";
import { ObjectId } from "mongodb";

class QuestionService extends Service {
  constructor(model) {
    super(model);
    this.findQuestion = this.findQuestion.bind(this);
    this.submitAnswer = this.submitAnswer.bind(this);
